import Alert from "react-bootstrap/Alert";

import "./app.css";

const Toastnew = () => {
  return (
    <div className="home">
      <Alert variant="success">
        <Alert.Heading>check your email </Alert.Heading>

        <hr />
      </Alert>
    </div>
  );
};

export default Toastnew;
